h3a5 5 0 0 1 5 5 5 5 0 0 1-5 5h-3m-6 0H6a5 5 0 0 1-5-5 5 5 0 0 1 5-5h3&quot;></path><line x1=8 y1=12 x2=16 y2=12></line></svg></a></span></h1></div></div></div></div><div class=&quot;stElementContainer element-container st-emotion-cache-1vo6xi6 e196pkbe0&quot; data-testid=stElementContainer data-stale=false width=100% height=auto overflow=visible><div class=stMarkdown data-testid=stMarkdown><div data-testid=stMarkdownContainer class=&quot;st-emotion-cache-467cry et2rgd20&quot;><p>Diese App (AMFUP steht für AMateurFUnkPrüfung-App) soll die Vorbereitung auf die Prüfungen der Bundesnetzagentur zum Erwerb der Funkamateurlizenzen unterstützen.</p></div></div></div><div class=&quot;stElementContainer element-container st-emotion-cache-1vo6xi6 e196pkbe0&quot; data-testid=stElementContainer data-stale=false width=100% height=auto overflow=visible><div class=stMarkdown data-testid=stMarkdown><div data-testid=stMarkdownContainer class=&quot;st-emotion-cache-467cry et2rgd20&quot;><p>Im Menüband links können aus folgenden Bereichen Teilprüfungen ausgewählt werden:</p>
<ul>
<li>Kenntnisse von Vorschriften</li>
<li>Betriebliche Kenntnisse</li>
<li>Technische Kenntnisse Klasse N</li>
<li>Technische Kenntnisse Klasse E</li>
<li>Technische Kenntnisse Klasse A</li>
</ul>
<p>Es werden in jedem Bereich zufällig 25 Fragen ausgewählt, wobei die Anzahl der Fragen aus einem Kapitel gewichtet wird mit dem Umfang des jeweiligen Kapitels, was dem Vorgehen der Bundesnetzagentur bei der Erstellung der Prüfungsbögen entspricht. Es ist jeweils nur eine Antwort richtig. Eine Teilprüfung gilt als bestanden, wenn mindestens 76% (19 Fragen) richtig beantwortet werden.</p>
<p>Es besteht die Möglichkeit, die falsch beantworteten bzw. die nicht beantworteten Fragen als CSV-Datei lokal auf Ihrem Rechner zu speichern und später als Liste wieder zu laden, um sie zu wiederholen. Probieren Sie dazu einfach im Menüband links die Optionen 'Export Fragenliste' bzw. 'Import Fragenliste' aus. Beim Import ist aus Performancegründen die maximale Anzahl an Fragen auf 50 begrenzt.</p>
<p>Eine Bearbeitung kompletter und zusammenhängender Kapitel ohne zufällige Auswahl ist unter 'Auswahl einzelner Kapitel' möglich. Auch hier ist die maximale Anzahl auf 50 Fragen begrenzt.</p>
<p>Seit Version 1.0.4 wird sowohl Light Mode als auch Dark Mode unterstützt. Einstellung unter Settings (3 Punkte oben rechts).</p>
